import logo from './logo.svg';
import './App.css';
import { useState, useEffect } from 'react';

const App = () => {
  const [counter, setCounter] =  useState(0);

  useEffect(() => {
    alert("You've changed the counter to " + counter)
  }, [counter]);

  return (
    <div className="App">
      <button onClick={() => setCounter((prevCounter) => prevCounter-1)}>
        -
      </button>
      <h1>{counter}</h1>
      <button onClick={() => setCounter((prevCounter) => prevCounter+1)}>
        +
      </button>
    </div>
  );
}

export default App;
